import Header from "../components/Header";
import Container from "../components/Container";
// import API from "../utils/API";
import users from "../user.json";

class Home extends Component {

state = {
    user: users
}


render() {
    return(
        <div>
            <Header  />
            <Container />
        </div>
    );
}


}

export default Home;
